    const weekday = ["Sun","Mon","Tue","Wed","Thu","Fri","Sat"];
    const month = ["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"];
    var currentdate = new Date();
    var currenttime = new Date();
    var min = currenttime.getMinutes();
    var hours = currenttime.getHours();
    var hr = hours%12||12;
    const Am =  hours >=12 ? "PM" : "AM";
    var o = weekday[currentdate.getDay()]+" "+currentdate.getDate()+" "+month[currentdate.getMonth()]+" "+hr+":"+min+" "+Am;
    function updateTime(){
      setTime(o);
    }
    setInterval(updateTime,2000);



  return (
    <>
     <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
 <body>
    <div className='nav'>
      <div className="left">
      <a onClick={toggleApple}><i className="fa fa-apple"></i></a>
      <a onClick={toggleFinder}><strong>Finder</strong></a>
      <a onClick={toggleFile}>File</a>
      <a onClick={toggleEdit}>Edit</a>
      <a onClick={toggleView}>View</a>
      <a onClick={toggleGo}>Go</a>
      <a  onClick={toggleWindow}>Window</a>
      <a onClick={toggleHelp}>Help</a>
      </div>
      <div className="right">
      <a><img className='playbttn' src={playbttn}/></a>
      <a className='wifi'><i className='fa fa-wifi'></i></a>
      <a><i className='fa fa-search'></i></a>
      <a><img className='io' src={io}/></a>
      <a><img className='siri' src={siri}/></a>
      <a><strong>{time}</strong></a>
      </div>
    </div>
          <Dock/>
 </body>
  </>
  )
}
